class ProjectIdea {
  constructor(id, categoryId, title, describtion, searched) {
    this.id = id;
    this.categoryId = categoryId;
    this.title = title;
    this.describtion = describtion;
    this. searched = searched;
  }
}

export default ProjectIdea;
